import React from 'react';
import {addpost, typePostInfo} from "../../../data/ProfileReduser";
import MyPosts from "./MyPosts";
import {connect} from "react-redux";

let StateProps = (state) =>{
    return{posts:state.ProfileData.Posts,
        TextNewPost:state.ProfileData.TextNewPost
    }
}



export default  connect(StateProps,{addpost,typePostInfo})(MyPosts)
